<script setup lang="ts">
    import { watch,onMounted } from 'vue';
    import gsap from 'gsap';

    const props = defineProps<{selected: boolean}>();

    onMounted(() => {
        gsap.fromTo("#message", 
        {

            scale:0.01,
            y:90
        }, 
        {

            scale:0.5,
            y:10,
            duration: 3,
        })
    })

    watch(props,()=>{
        gsap.fromTo("#message", 
        {
            opacity:1,
        }, 
        {
            opacity:0,
            duration: 1,
        })
        gsap.fromTo("#welcome-star",
        {
            rotation:-5
        },
        {
            rotation:5,
            duration:2,
            repeat:3,
            yoyo:true
        })
        gsap.fromTo("#welcome-star", 
        {
            opacity:1,
        }, 
        {
            opacity:0,
            duration: 2,
        })
    })

</script>
    
